import React from "react";

export default function main(){
    return(
        <>
        <div class="container">
            <nav class="navbar navbar-expand-lg bg-body-tertiary">
                <div class="container-fluid text-align-center">
                    <a class="navbar-brand " href="#">Navbar</a>
                </div>
            </nav>
        </div>
        </>
    )
}
